import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/PeripheralsPage.css'; // Assuming you want to use the same styles

const KeyboardPage = () => {
  const keyboardData = [
    { id: '67ff0ea6173e97a1a082e4c1', name: 'Logitech G915 LIGHTSPEED', image: 'data:image/jpeg;base64,', slug: 'logitech-g915-lightspeed' },
  { id: '67ff0ea6173e97a1a082e4c2', name: 'Corsair K100 RGB OPX', image: 'data:image/jpeg;base64,', slug: 'corsair-k100-rgb-opx' },
  { id: '67ff0ea6173e97a1a082e4c3', name: 'Razer Huntsman V2 Analog', image: 'data:image/jpeg;base64,', slug: 'razer-huntsman-v2-analog' },
  { id: '67ff0ea6173e97a1a082e4c4', name: 'SteelSeries Apex Pro', image: 'data:image/jpeg;base64,', slug: 'steelseries-apex-pro' },
  { id: '67ff0ea6173e97a1a082e4c5', name: 'HyperX Alloy Origins 60', image: 'data:image/jpeg;base64,', slug: 'hyperx-alloy-origins-60' },

  ];

  return (
    <div className="keyboard-page">
      <h2>Browse Keyboards</h2>
      <div className="keyboard-grid">
        {keyboardData.map((keyboard) => (
          <Link to={`/product/${keyboard.id}`} key={keyboard.id} className="keyboard-card">
            <img src={keyboard.image} alt={keyboard.name} />
            <h3>{keyboard.name}</h3>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default KeyboardPage;
